import React from 'react';
import studentGallery from '../photos/laba.jpg';

const Gallery = () => {
  return (
    <div className='relative mt-10'>
      <img src={studentGallery} alt="Custom Icon" className="w-full h-[449px] opacity-40" />
      <div className="absolute flex justify-center text-black">
        {/* <p className="text-6xl font-playfair font-bold text-center"> */}
          Our events gallery heyyyyyyyyyy
        {/* </p> */}
      </div>
    </div>
  );
};

export default Gallery;
